39\">\u041c\u0438\u0445\u0430\u0438\u043b\u043e\u043c \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0438\u0447\u0435\u043c \u041c\u043e\u0436\u0430\u0439\u0441\u043a\u0438\u043c<\/a>. \u0421\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0435\u0433\u043e \u0442\u0435\u043a\u0441\u0442\u0443, \u043a\u043d\u044f\u0437\u044c \u0437\u0430\u0432\u0435\u0449\u0430\u043b \u043f\u043e\u0441\u043b\u0435 \u0441\u0432\u043e\u0435\u0439 \u0441\u043c\u0435\u0440\u0442\u0438 \u0411\u0435\u043b\u043e\u043e\u0437\u0435\u0440\u043e \u0432\u0435\u043b\u0438\u043a\u043e\u043c\u0443 \u043a\u043d\u044f\u0437\u044e. \u042d\u0442\u043e \u0431\u044b\u043b\u043e \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0443\u0449\u0435\u043c\u043b\u0435\u043d\u0438\u0435\u043c \u043f\u0440\u0430\u0432 \u0441\u044b\u043d\u0430 \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0438\u0447\u0430&#160;\u2014 \u0412\u0430\u0441\u0438\u043b\u0438\u044f \u0438 \u0441\u0442\u0430\u043b\u043e \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u0432 \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0438 \u0418\u0432\u0430\u043d\u0430 III \u043d\u0430 \u043f\u0440\u0430\u0432\u0430 \u0443\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u043a\u043d\u044f\u0437\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1541_%D0%B3%D0%BE%D0%B4\" title=\"1541 \u0433\u043e\u0434\">1541<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D0%B7%D1%83%D0%B8%D1%82%D1%8B\" title=\"\u0418\u0435\u0437\u0443\u0438\u0442\u044b\">\u0438\u0435\u0437\u0443\u0438\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B3%D0%BD%D0%B0%D1%82%D0%B8%D0%B9_%D0%B4%D0%B5_%D0%9B%D0%BE%D0%B9%D0%BE%D0%BB%D0%B0\" title=\"\u0418\u0433\u043d\u0430\u0