32\u0435\u0440\u0448\u0438\u043b \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0435 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435. \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_I\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 I\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 I<\/a> \u043f\u0440\u0438\u0431\u044b\u043b\u0430 \u043d\u0430 \u0431\u043e\u0440\u0442 \u0435\u0433\u043e \u0441\u0443\u0434\u043d\u0430 \u00ab\u041f\u0435\u043b\u0438\u043a\u0430\u043d\u00bb \u0438 \u043f\u043e\u0441\u0432\u044f\u0442\u0438\u043b\u0430 \u0435\u0433\u043e \u0432 \u0440\u044b\u0446\u0430\u0440\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1660_%D0%B3%D0%BE%D0%B4\" title=\"1660 \u0433\u043e\u0434\">1660<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b II (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u041a\u0430\u0440\u043b II<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B5%D0%BA%D0%BB%D0%B0%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0411\u0440\u0435\u0434\u0441\u043a\u0430\u044f \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044f\">\u0411\u0440\u0435\u0434\u0441\u043a\u0443\u044e \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044e<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0443\u0441\u043b\u043e\u0432\u0438\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D1%82%D0%B0%D0%B2%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82%D0%BE%D0%B2\" title=\"\u0420\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0446\u0438\u044f \u0421\u0442\u044e\u0430\u0440\u0442\u043e\u0432\">\u0440\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%BE%D0%BD%D0%B0%D1%80%D1%85%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u044f\">\u043c\u043e\u043d\u0430\u0440\u0445\u0438\u0438<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1719_%D0%B3%D0%BE%D0%B4\" title=\"1719 \u0433\u043e\u0434\">1719<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%BB%D0%B0%D0%B4%D0%BE%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u0421\u0442\u0430\u0440\u043e\u043b\u0430\u0434\u043e\u0436\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b\">\u041b\u0430\u0434\u043e\u0436\u0441\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u0430\u043b\u0430<\/a>. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1753_%D0%B3%D0%BE%D0%B4\" title=\"1753 \u0433\u043e\u0434\">1753<\/a>&#160;\u2014 \u0423\u043a\u0430\u0437\u043e\u043c \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u044b \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u043e\u0442\u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D0%B7%D0%BD%D1%8C\" title=\"\u0421\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c\">\u0441\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1785_%D0%B3%D0%BE%D0%B4\" title=\"1785 \u0433\u043e\u0434\">1785<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%82%D1%80%D0%B0%D0%B9%D1%82,_%D0%AD%D0%B4%D0%BC%D1%83%D0%BD%D0%B4\" title=\"\u041a\u0430\u0440\u0442\u0440\u0430\u0439\u0442, \u042d\u0434\u043c\u0443\u043d\u0434\">\u042d\u0434\u043c\u0443\u043d\u0434 \u041a\u0430\u0440\u0442\u0440\u0430\u0439\u0442<\/a> \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u043f\u0430\u0442\u0435\u043d\u0442 \u043d\u0430 \u043c\u0435\u0445\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u043a\u0430\u0446\u043a\u0438\u0439 \u0441\u0442\u0430\u043d\u043e\u043a \u0441 \u043d\u043e\u0436\u043d\u044b\u043c