438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B6%D0%B8%D1%80\" title=\"\u0410\u043b\u0436\u0438\u0440\">\u0410\u043b\u0436\u0438\u0440<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0442 100-\u043b\u0435\u0442\u043d\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D0%BE%D0%B4_%D0%A0%D0%B0%D1%86%D0%BB%D0%B0%D0%B2%D0%B8%D1%86%D0%B0%D0%BC%D0%B8\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u0420\u0430\u0446\u043b\u0430\u0432\u0438\u0446\u0430\u043c\u0438\">\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u0420\u0430\u0446\u043b\u0430\u0432\u0438\u0446\u0430\u043c\u0438<\/a>, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u043e\u0439\u0441\u043a\u0430 \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u0445 \u043f\u043e\u0432\u0441\u0442\u0430\u043d\u0446\u0435\u0432 \u043f\u043e\u0434 \u043f\u0440\u0435\u0434\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D1%82%D1%8E%D1%88%D0%BA%D0%BE,_%D0%A2%D0%B0%D0%B4%D0%B5%D1%83%D1%88\" title=\"\u041a\u043e\u0441\u0442\u044e\u0448\u043a\u043e, \u0422\u0430\u0434\u0435\u0443\u0448\">\u0422\u0430\u0434\u0435\u0443\u0448\u0430 \u041a\u043e\u0441\u0442\u044e\u0448\u043a\u043e<\/a> \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u043f\u043e\u0431\u0435\u0434\u0443 \u043d\u0430\u0434 \u0446\u0430\u0440\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1809_%D0%B3%D0%BE%D0%B4\" title=\"1809 \u0433\u043e\u0434\">1809<\/a>&#160;\u2014 \u0440\u0443\u04