4\u0440 \u0424\u0438\u043b\u0438\u043f\u043f\u043e\u0432\u0438\u0447\">\u0421\u043c\u0438\u0440\u0434\u0438\u043d\u0430<\/a> \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u043e\u043b\u043d\u043e\u0435 \u0438\u0437\u0434\u0430\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%9E%D0%BD%D0%B5%D0%B3%D0%B8%D0%BD\" title=\"\u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u041e\u043d\u0435\u0433\u0438\u043d\">\u0415\u0432\u0433\u0435\u043d\u0438\u044f \u041e\u043d\u0435\u0433\u0438\u043d\u0430<\/a>\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041f\u0443\u0448\u043a\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850_%D0%B3%D0%BE%D0%B4\" title=\"1850 \u0433\u043e\u0434\">1850<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%81-%D0%90%D0%BD%D0%B4%D0%B6%D0%B5%D0%BB%D0%B5%D1%81\" title=\"\u041b\u043e\u0441-\u0410\u043d\u0434\u0436\u0435\u043b\u0435\u0441\">\u041b\u043e\u0441-\u0410\u043d\u0434\u0436\u0435\u043b\u0435\u0441<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4\" title=\"\u0413\u043e\u0440\u043e\u0434\">\u0433\u043e\u0440\u043e\u0434\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B0%D0%BA%D0%BE%D0%B7%D0%BE%D0%B2,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0440\u0430\u043a\u043e\u0437\u043e\u0432, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0414\u043c\u0438\u0442\u0440\u0438\u044f \u041a\u0430\u0440\u0430\u043a\u043e\u0437\u043e\u0432\u0430<\/a> \u043d\u0430 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a>. \u0426\u0430\u0440\u044c \u043e\u0441\u0442\u0430\u043b\u0441\u044f \u0432 \u0436\u0438\u0432\u044b\u0445, \u0430 \u041a\u0430\u0440\u0430\u043a\u043e\u0437\u043e\u0432 \u0431\u044b\u043b \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0451\u043d \u043a \u043f\u043e\u0432\u0435\u0448\u0435\u043d\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1884_%D0%B3%D0%BE%D0%B4\" title=\"1884 \u0433\u043e\u0434\">1884<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0438\u0432\u0438\u044f\">\u0411\u043e\u043b\u0438\u0432\u0438\u044f<\/a> \u043f\u0435\u0440\u0435\u0434\u0430\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0427\u0438\u043b\u0438\">\u0427\u0438\u043b\u0438<\/a> \u043f\u0440\u0438\u0431\u0440\u0435\u0436\u043d\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%BE%D1%84%D0%B0%D0%B3%D0%B0%D1%81%D1%82%D0%B0_(%D0%BF%D1%80%D0%BE%D0%B2%D0%B8%D0%BD%D1%86%D0%B8%D1%8F)\" title=\"\u0410\u043d\u0442\u043e\u0444\u0430\u0433\u0430\u0441\u0442\u0430 (\u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u044f)\">\u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u044e \u0410\u043d\u0442\u043e\u0444\u0430\u0433\u0430\u0441\u0442\u0443<\/a>, \u043b\u0438\u0448\u0430\u044f\u0441\u044c \u0432\u044b\u0445\u043e\u0434\u0430 \u043a \u043c\u043e\u0440\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f \u043e\u0431 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0438\u0438 \u0440\u043e\u0441\u0441\u044b\u043f\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE\" title=\"\u0417\u043e\u043b\u043e\u0442\u043e\">\u0437\u043e\u043b\u043e\u0442\u0430<\/a> \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%B0%D1%8F_%D0%BB%D0%B8%D1%85%D0%BE%D1%80%D0%B0%D0%B4%D0%BA%D0%B0_%D0%BD%D0%B0_%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B5\" title=\"\u0417\u043e\u043b\u043e\u0442\u0430\u044f \u043b\u0438\u0445\u043e\u0440\u0430\u0434\u043a\u0430 \u043d\u0430 \u0410\u043b\u044f\u0441\u043a\u0435\">\u0437\u043e\u043b\u043e\u0442\u0430\u044f \u043b\u0438\u0445\u043e\u0440\u0430\u0434\u043a\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BA%D0%BE%D0%BD_(%D1%82%D0%B5%D1%80%D1%80%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D1%8F)\" title=\"\u042e\u043a\u043e\u043d (\u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u044f)\">\u042e\u043a\u043e\u043d\u0435<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a><ul><li>\u041d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u043f\u043e\u0441\u043e\u043b \u0432 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043f\u043b\u0430\u043d \u043f\u0440\u043e\u0435\u0437\u0434\u0430 \u0447\u0435\u0440\u0435\u0437 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u044e \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u043b\u0438\u0434\u0435\u0440\u043e\u0432 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u0438; \u0432\u0435\u0440\u043d\u0443\u0432\u0448\u0438\u0439\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434<\/a> \u0438\u0437 \u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u041b\u0435\u043d\u0438\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0418\u043b\u044c\u0438\u0447\">\u0412.&#160;\u0418.&#160;\u041b\u0435\u043d\u0438\u043d<\/a> \u0441\u0444\u043e\u0440\u043c\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043b \u0442.&#160;\u043d. \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B5_%D1%82%D0%B5%D0%B7%D0%B8%D1%81%D1%8B\" title=\"\u0410\u043f\u0440\u0435\u043b\u044c\u0441\u043a\u0438\u0435 \u0442\u0435\u0437\u0438\u0441\u044b\">\u0410\u043f\u0440\u0435\u043b\u044c\u0441\u043a\u0438\u0435 \u0442\u0435\u0437\u0438\u0441\u044b<\/a>\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u043b \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u043e\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u044d\u0442\u0430\u043f\u0430 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438 \u043a\u043e \u0432\u0442\u043e\u0440\u043e\u043c\u0443, \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443&#160;\u2014 \u0431\u043e\u0440\u043e\u0442\u044c\u0441\u044f \u043d\u0435 \u0437\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0443\u044e \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443, \u0430 \u0437\u0430 \u00ab\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443 \u0421\u043e\u0432\u0435\u0442\u043e\u0432\u00bb.<\/li><li>\u041c\u0438\u043d\u0438\u0441\u0442\u0440 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0420\u043e\u0441\u0441\u0438\u0438\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D1%8E%D0%BA%D0%BE%D0%B2,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0438\u043b\u044e\u043a\u043e\u0432, \u041f\u0430\u0432\u0435\u043b \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u041f.\u041c\u0438\u043b\u044e\u043a\u043e\u0432<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u0432\u043d\u0435\u0448\u043d\u0438\u0445 \u0446\u0435\u043b\u044f\u0445 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432 \u0445\u043e\u0434\u0435 \u0432\u043e\u0439\u043d\u044b: \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u0438, \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438, \u0432\u043e\u0441\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0445 \u0437\u0435\u043c\u0435\u043b\u044c \u0410\u0432\u0441\u0442\u0440\u043e-\u0412\u0435\u043d\u0433\u0440\u0438\u0438 \u0441 \u0420\u043e\u0441\u0441\u0438\u0435\u0439 \u0438 \u043e\u0431\u043b\u0430\u0434\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\">\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u0435\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D1%84%D0%BE%D1%80\" title=\"\u0411\u043e\u0441\u0444\u043e\u0440\">\u0411\u043e\u0441\u0444\u043e\u0440\u0441\u043a\u0438\u043c \u043f\u0440\u043e\u043b\u0438\u0432\u043e\u043c<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u0430\u044f \u0430\u0432\u0438\u0430\u043b\u0438\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B0%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u041d\u0435\u0430\u043f\u043e\u043b\u044c\">\u041d\u0435\u0430\u043f\u043e\u043b\u044c<\/a> \u043d\u0430 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044f\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u0418\u0437\u0431\u0440\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C,_%D0%9F%D1%91%D1%82%D1%80_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0412\u0440\u0430\u043d\u0433\u0435\u043b\u044c, \u0